script: |
  super -f text -I q10102.spq | sort > q10102.out

inputs:
  - name: q10102.spq
    data: |
      SELECT ALL - col0 * col1 FROM tab1 (FORMAT parquet) WHERE NULL BETWEEN - col0 * + 25 - - col2 / + col1 + col1 * - 83 AND NULL AND NOT NULL IS NOT NULL;
  - name: tab1

outputs:
  - name: q10102.out
    data: |
